import React, { useState } from 'react';
import './TasksTable.css';

const tasksTable = function() {

    return (
        <div className="tasks-table-container">
            <p>test</p>
            <table className="tasks-table">
                <tr>
                    <th>#</th>
                    <th>Task</th>
                    <th>Points done</th>
                    <th>Points left</th>
                </tr>
            </table>
        </div>
    );
}

export default tasksTable;
